import React from 'react';
import { FaLinkedin, FaGithub, FaTwitter, FaCog } from 'react-icons/fa';
import { motion } from 'framer-motion';

const Navbar = () => {
  return (
    <nav className="bg-white shadow sticky top-0 z-50">
      <div className="container mx-auto flex justify-between items-center p-4">
        <motion.h1 
          initial={{ opacity: 0, x: -20 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.6 }}
          className="text-xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent"
        >
          Piyush Unde
        </motion.h1>
        
        <div className="flex items-center gap-4">
          {/* Admin Indicator */}
          <motion.div
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.6, delay: 0.3 }}
            className="flex items-center gap-2 text-xs text-gray-500 bg-gray-100 px-3 py-1 rounded-full"
          >
            <FaCog className="text-gray-400" />
            <span>Admin: Ctrl+Shift+A</span>
          </motion.div>
          
          {/* Social Links */}
          <div className="flex space-x-4 text-blue-600 text-xl">
            <motion.a 
              href="https://www.linkedin.com/in/piyush-unde-6b1a07287/" 
              target="_blank" 
              rel="noopener noreferrer" 
              aria-label="LinkedIn"
              whileHover={{ scale: 1.1, y: -2 }}
              whileTap={{ scale: 0.95 }}
              className="hover:text-blue-800 transition-colors"
            >
              <FaLinkedin />
            </motion.a>
            <motion.a 
              href="https://github.com/Piyush3430" 
              target="_blank" 
              rel="noopener noreferrer" 
              aria-label="GitHub"
              whileHover={{ scale: 1.1, y: -2 }}
              whileTap={{ scale: 0.95 }}
              className="hover:text-gray-800 transition-colors"
            >
              <FaGithub />
            </motion.a>
            <motion.a 
              href="https://twitter.com/" 
              target="_blank" 
              rel="noopener noreferrer" 
              aria-label="Twitter"
              whileHover={{ scale: 1.1, y: -2 }}
              whileTap={{ scale: 0.95 }}
              className="hover:text-blue-400 transition-colors"
            >
              <FaTwitter />
            </motion.a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
